import React from 'react';
import { Container, Grid, Typography, Box, CssBaseline, ThemeProvider, createTheme } from '@mui/material';
import './App.css';
import { theme } from './theme';

const credits = [
  'DEN OF THIEVES 2.png', 'FROM.png', 'PRISCILLA.png', 'THE CONSULTANT.png',
  'THE NUTCRACKERS.png', 'CHAPELWAITE.jpg', 'BILLY.jpg', 'GEORGETOWN.png', 'DUAL.jpg'
];


function Section({ title, children }) {
  return (
    <Container sx={{ pl: 10, pr: 10, mb: 4 }}>
      <Typography variant="h4" sx={{ pt: 3, pb: 3 }}>{title}</Typography>
      <Box className="box">{children}</Box>
    </Container>
  );
}

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      {/* Header */}
      <Container>
        <Grid container justifyContent="flex-end" alignItems="center" sx={{ pt: 5, pr: 10 }}>
          <img src="/Ryan Allam Logo.png" className="logo-img" alt="Logo" />
          <img src="/Ryan Allam Logo_name.png" className="logo-name" alt="Logo Name" />
        </Grid>
      </Container>

      {/* Selected Credits */}
      <Section title="Selected Credits">
        <Container id="grid" sx={{ pl: 0, pr: 0 }}>
          <Grid container spacing={2}>
            {credits.map((src, i) => (
              <Grid item xs={12} sm={6} md={4} key={i}>
                <Box className="credit-box">
                  <img src={`/${src}`} alt={`Credit ${i + 1}`} className="credit-img" />
                  <span className="zoom-overlay">press to zoom</span>
                </Box>
              </Grid>
            ))}
          </Grid>
        </Container>
      </Section>

      {/* About */}
      <Section title="About">
        <Box sx={{ display: 'flex', alignItems: 'flex-start', flexWrap: 'wrap' }}>
          <img src="/Ryan_bio.jpg" className="bio-image" alt="Bio" />
          <Typography component="p" className="stretch-text" sx={{ ml: 2 }}>
            Ryan Joe Allam is a trilingual sound editor and sound designer based in Toronto. He has a diverse body of work in Film, Television, Commercial and Radio Production. His passion for music started early on. At the age of fifteen, he taught himself to play the guitar and piano. By the time he was 17, he had started his own soft rock band, called Camel's Night Out. In addition to being the lead vocalist and rhythm guitarist, he started composing soft rock tracks and added them to the band’s portfolio. After spending his early years in the IT industry, he decided to return to his passion in 2008 and start a career in what he loved doing the most: Sound.

            Sound is an integral part of any feature film. It can set the mood, inform the story and ignite emotions.  Imagine looking at a close up of a character’s face without any sound. You may think that nothing interesting is going on.  Now add some background sound such as fast-moving traffic, car horns, a distant police siren and a few shout outs. The story suddenly takes shape and you can’t help but wonder: Why is she standing so close to a highway? Is she lost? What if she gets hit by a car?
            When executed skillfully, sound transforms the audience’s experience while remaining a seamless part of the film.
          </Typography>
        </Box>
      </Section>

      {/* Podcasts */}
      <Section title="Podcasts">
        <Typography component="p" className="stretch-text">
          In February 2009, I was asked to produce a podcast with Nanette Midwood...
        </Typography>
      </Section>

      {/* Mixing */}
      <Section title="Mixing">
        <Typography component="p" className="stretch-text">
          In my constant quest to better myself, I joined Berklee College of Music...
        </Typography>
      </Section>

      {/* Contact */}
      <Section title="Contact">
        <Typography component="p" className="stretch-text">
          Do you have any question? Or just thinking about a project? Drop me a line at ryanallam@gmail.com...
        </Typography>
      </Section>

      {/* Footer */}
      <Container sx={{ py: 4 }}>
        <Typography variant="body2" align="center" className="stretch-text">
          2008 - 2025 © by Ryan Joe Allam<br />
          The content, logos and brand name appearing on this Site are the property of their respective owners.
        </Typography>
      </Container>
    </ThemeProvider>
  );
}

export default App;
